var _hoisted_33 = /*#__PURE__*/(0,vue__WEBPACK_IMPORTED_MODULE_0__.createStaticVNode)("<p data-v-33ec115f>Last part is adding theme and layout css files, in the CLI app they are defined using link tags in index.html so the demo can switch them on the fly by changing the path however if this is not a requirement, you may also add them to the styles configuration above so they go inside the bundle.</p><h4 data-v-33ec115f>Integration with an Existing Non-CLI Project</h4><p data-v-33ec115f>For an existing project that do not use CLI, setup steps are more or less similar. Start with installing the dependencies listed above in package.json</p><p data-v-33ec115f>Copy the <i data-v-33ec115f>src/assets</i> folder to your application and include the resources listed above with a module bundler like webpack or using link-script tags.</p><p data-v-33ec115f>Finally copy the contents of App.vue to your application&#39;s main component template such as <i data-v-33ec115f>app/index.html</i> along with the sub components which are AppMenu.vue, AppTopbar.vue and AppFooter.vue.</p><h4 data-v-33ec115f>Component Theme</h4><p data-v-33ec115f>Babylon provides 17 PrimeVue themes out of the box, setup of a theme simple including the css of theme to your page that is located inside public/assets/sass/theme folder such as <b data-v-33ec115f>assets/theme/theme-blue.css</b>.</p><p data-v-33ec115f>In the demo application, theme css file is added to the index page to enable themeswitcher functionality however since VueCLI supports SASS compilation via webpack, you may also import the sass of the theme to App.vue as well.</p><p data-v-33ec115f>Full list of available themes are;</p><ul data-v-33ec115f><li data-v-33ec115f>amber</li><li data-v-33ec115f>blue</li><li data-v-33ec115f>bluegrey</li><li data-v-33ec115f>brown</li><li data-v-33ec115f>cyan</li><li data-v-33ec115f>deeporange</li><li data-v-33ec115f>deeppurple</li><li data-v-33ec115f>green</li><li data-v-33ec115f>indigo</li><li data-v-33ec115f>lightblue</li><li data-v-33ec115f>lightgreen</li><li data-v-33ec115f>lime</li><li data-v-33ec115f>orange</li><li data-v-33ec115f>pink</li><li data-v-33ec115f>purple</li><li data-v-33ec115f>teal</li><li data-v-33ec115f>yellow</li></ul><p data-v-33ec115f>A custom theme can be developed by the following steps.</p><ul data-v-33ec115f><li data-v-33ec115f>Choose a custom theme name such as theme-myown.</li><li data-v-33ec115f>Create a file named theme-myown.scss under <i data-v-33ec115f>public/assets/sass/theme folder</i>.</li><li data-v-33ec115f>Define the variables listed below and import the <i data-v-33ec115f>../sass/theme/_theme.scss</i> file.</li><li data-v-33ec115f>Build the scss to generate css.</li><li data-v-33ec115f>Include the theme file to your application.</li></ul><p data-v-33ec115f>Here are the variables required to create a theme.</p>", 13);

